scriptlet.script:
var jsCondArr = scriptletInput.split(",");
var jsVolumeNameAssigned = jsCondArr[0];
var jsLunPathNameAssigned = jsCondArr[1];
var jsInputArgsOk = "true";

if (jsVolumeNameAssigned == "true" && jsLunPathNameAssigned == "true")
{
    jsInputArgsOk = "volumeName and lunPathName are mutually exclusive - only one of the two may be specified as a flow input";
}
else if (jsVolumeNameAssigned != "true" && jsLunPathNameAssigned != "true")
{
    jsInputArgsOk = "one of either volumeName or lunPathName must be specified as a flow input";
}
scriptletResult = jsInputArgsOk;

